import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles({
  root: {
    minWidth: 275,
    maxWidth: 1000,
    minHeight: 500,
  },
  bullet: {
    display: "inline-block",
    margin: "0 5px",
    transform: "scale(0.8)",
  },
  title: {
    fontSize: 30,
    fontWeight: "bold",
    paddingLeft: 200,
  },
  pos: {
    marginBottom: 12,
  },
  span: {
    paddingLeft: 100,
  },
});

function BookingScreen() {
  const classes = useStyles();

  return (
    <div className="form-topview">
      <Card className={classes.root}>
        <CardContent>
          <Typography
            className={classes.title}
            color="textSecondary"
            gutterBottom
          >
            Register For Vaccination
          </Typography>

          <div className="form-midview">
            <p>
              Your Photo ID will be verified at the time of your vaccination
              appointment. Please provide the details <br />
              <span className={classes.span}>
                of the Photo ID you will carry for vaccination
              </span>
            </p>
          </div>
        </CardContent>
      </Card>
    </div>
  );
}

export default BookingScreen;
